import React from 'react';
import ReactDOM from 'react-dom';


function BookList() {
    return (
        <>
            <Book />
        </>
    )
}

const Book = () => {
    return (
        <article>
            <Image />
            This is a Book
        </article>
    )
}

const Image = () => <img src='https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg' alt='' />


ReactDOM.render(
    <>
        <BookList />

    </>

    ,
    document.getElementById('root')
)
